import './App.css';
import Header from "./Header";
function App() {
  const name = "Piotr";

  const handleNameChange = () => {
      const names = ['bob', 'piotr', 'max'];
      const int = Math.floor(Math.random()*3);

      return names[int];
  }



  return (
      <div className="App">
          <Header/>
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo"/>
          <p>
                Hello {handleNameChange()} !
          </p>
        {/*<p>{name}</p>*/}
        </header>

      </div>


  );
}

export default App;
